    @ParameterizedTest
    @MethodSource
    public void testReadColumnPruning(String tableName, long expectedTotalRows, boolean withKey) throws Exception {
        Schema tableSchema = ArrowUtils.toArrowSchema(restClient.getTableSchema(DEFAULT_CATALOG, dbName, tableName), TZ);
        List<TablePartition> partitions = restClient.listTablePartitions(DEFAULT_CATALOG, dbName, tableName, false);
        assertFalse(partitions.isEmpty());
        // setup required schema
        List<Field> fields = new ArrayList<>();
        if (withKey) {
            // add the key column;
            fields.addAll(tableSchema.getFields().stream()
                    .filter(col -> "true".equals(col.getMetadata().get(ArrowUtils.STARROKCS_COLUMN_IS_KEY)))
                    .collect(Collectors.toList()));
        }

        List<Field> nonkeyFields = tableSchema.getFields().stream()
                .filter(col -> !"true".equals(col.getMetadata().get(ArrowUtils.STARROKCS_COLUMN_IS_KEY)))
                .collect(Collectors.toList());
        Collections.shuffle(nonkeyFields);
        fields.addAll(nonkeyFields
                .subList(0, Math.max(1, RandomUtils.nextInt(0, nonkeyFields.size()))));
        for (Field field : fields) {
            System.out.println(
                    "Read column(" + field.getMetadata().get(ArrowUtils.STARROKCS_COLUMN_ID) + "): " + field.getName());
        }
        Schema requiredSchema = new Schema(fields, tableSchema.getCustomMetadata());

        // read chunk
        long totalRows = 0;
        for (TablePartition partition : partitions) {
            long version = partition.getVisibleVersion();
            for (TablePartition.Tablet tablet : partition.getTablets()) {
                Long tabletId = tablet.getId();

                try {
                    Config config = settings.toConfig();
                    config.setUsingColumnUid("false");

                    StarRocksReader reader = new StarRocksReader(
                            tabletId, partition.getStoragePath(), version, requiredSchema, requiredSchema, config);
                    reader.open();

                    long numRows;
                    do {
                        VectorSchemaRoot vsr = reader.next();
                        numRows = vsr.getRowCount();

                        if (withKey) {
                            checkValue(vsr, numRows);
                        }
                        vsr.close();

                        totalRows += numRows;
                    } while (numRows > 0);

                    // should be empty chunk
                    VectorSchemaRoot vsr = reader.next();
                    assertEquals(0, vsr.getRowCount());
                    vsr.close();

                    reader.close();
                    reader.release();
                } catch (Exception e) {
                    e.printStackTrace();
                    fail();
                }
            }
        }

        assertEquals(expectedTotalRows, totalRows);
    }

